import React from "react";

import * as actions from "./../../../../store/actions/actionTypes";
import classes from "./Tachas.module.css";
import ArrowForwardIosIcon from "@material-ui/icons/ArrowForwardIos";
import { connect } from 'react-redux';


const Tachas = (props) => {

  const arrayClasses=[classes.itemHeader, classes.fill];
  const arrayClasses1=[classes.displayPad, classes.open]
  const arrayClasses2=[classes.tipo, classes.fill2];

  const tachaClicked = (tamanio, precio) =>{
    props.selectTacha(tamanio, precio);
    props.onClickOnTacha()
  }

  const opciones = props.tachas.map((tacha, i) => (
    <ul style={{paddingInlineStart: "0px"}} key={i}>
      <li style={{listStyle: "none", position: "relative"}}>
        <div 
        onClick={()=>tachaClicked(tacha.tamanio, tacha.precio)}
        className={classes.itemHeader}>
          <span className={classes.arrow}><ArrowForwardIosIcon/></span>
          <span>{tacha.tamanio}</span>
          <span className={classes.price}>{tacha.precio}</span></div>
        <ul 
       className={classes.listaTipos}
        style={{paddingInlineStart: "0px"}}>
          {tacha.tipo.map(modelo =>(
            <li  
            key={Math.random()*100}
            className={classes.tipo}>
              <img
              className={classes.image}
              alt="img"
              src="https://d26lpennugtm8s.cloudfront.net/stores/718/076/products/73891531-96a5-4833-8d98-8b51cd9611c7_nube-385bafc285b6c688dd15290787244065-640-0.jpg"
              />
              <p>{modelo.tipo}</p></li>
          ))}
        </ul>
      </li>
    </ul>
  ))

  return (
    <div className={classes.Tachas}>
      <h2>Tachas</h2>
      <div className={classes.item}>
        {opciones}  
      </div> 
    </div>
  );
};

const mapDispatchToProps=dispatch => {
  onClickOnTacha: ()=>dispatch({type: actions.DISPLAY_TACHA_OPTIONS})
}


export default connect(null,mapDispatchToProps)(Tachas);
